- input: "TEXT\x1CC00302422\x1CX0\x1C\x1CF3A\x1CMr. Bradley Matheson, Sr. Campaign
    Finance & Reviewing Analyst, Reports Analysis Division. Federal Election Commission
    ID #C00302422. Reference: April Quarterly Report (01/01/2014-03/31/2014)    Dear
    Mr. Matheson, This letter is in response to the Commission?s preliminary review
    of the Rangel for Congress April Quarterly Report. The review of that report identified
    one or more contributions that appear to exceed the contribution limits. Two contributions
    were misclassified as primary election contributions. This amendment correctly
    reflects those contributions as general election contributions. The Committee
    has refunded two excessive contributions. The disbursement of the refunded contributions
    will appear in the Committees next FEC report. Copies of the refund checks were
    hand delivered to the FEC on 5/29/2014. The review also identified disbursement
    descriptions that required clarification. This amendment clarifies the purpose
    of the identified disbursements. The review also identified an expense reimbursement
    and credit card payments that needed memo entries for the original vendor, if
    payments to the original vendor are in excess of $200 aggregate. This amendment
    includes memo entries for original vendors who have been distributed an aggregate
    amount in excess of $200 in the election cycle. Please note that payments to vendors
    who have an aggregate distribution under the $200 reporting threshold are not
    included in the memo fields.\n"
